import React from 'react'
import { ChannelCard, VidioCard} from '../index'


const Vidios = (props) => {
    const vidios = props.Vidios
    console.log(vidios)
    return (
        <>
            {vidios.map((item , inx) => {
                if (item.id.vidioId) {
                    return <VidioCard vidio={item} key={inx} />
                }else {
                    return <ChannelCard vidio={item} key={inx} />
                }
            
            })}        
        </>

        
    )
}

export default Vidios
